import React, { useEffect } from 'react'

const BASEURL = "https://api.github.com/search/repositories?q=created:%3E2019-01-10&sort=stars";
function DataFetching() {
const [repos, setRepos] = useState([]);

useEffect(() => {
    fetch(BASEURL)
    .then((res) => res.json())
    .then((data) =>{
        setRepos(data);
    })
    .catch(err => {
        console.log(err)
    });


},[]);

console.log(repos);

return(
    <div>
       {repos.items.map((repo) => <p>{repo.owner.url}</p>)}
    </div>);
}

export default DataFetching
